import './App.css';

function App() {
  return (
    <div className="App">
      <div classname = "datos">
        <label>Canal: <input type ='text'></input></label><br/>
        <label>Frecuencia: <input type ='text'></input></label><br/>
        <label>Modo: <input type ='text'></input></label><br/>
        <label>Uso: <input type ='text'></input></label><br/>
      </div>
    </div>
  );
}

export default App;
